import React, { Component } from 'react'
import '/Users/mananlodhia/Desktop/RMIT/Year 3/Semester 1/SEPT/Assignments/A1/SEPTECH/frontend/todo-app/src/components/sept/sept.css'
import Chat from './Chat.jsx'


class ChatMain extends Component {
  render() {

    let links = [
      { label: 'Home', link: '/index', },
      { label: 'Chat', link: '/index', },
      { label: 'User Posts', link: '/posts', },
      { label: 'Profile', link: '/profile', active: true },
      { label: 'Logout', link: '/logout' },
  ];

    return (
      <div className="App">
        <header className="App-header">
          <h1 className="App-title">Chat App</h1>
        </header>
        <Chat />
      </div>
    )
  }
}

export default ChatMain
